import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection2 from '../HeroSection2';
import Footer from '../Footer';
import Navbar from '../Navbar';

function AboutUs() {
    return (
      <>
      <Navbar />
        <HeroSection2 />
        <Footer />
      </>
    );
  }
  
  export default AboutUs;
